import './App.css';
import Feedback from './components/feedback';
import Account from './components/createAccount';
import Login from './components/login';
import {Router,Switch,Link, Route} from 'react-router-dom';
function App(props){
  return(

      <Router>
        <div className="App">
        <Switch>
          <Route path='/'>
            <Login/>
          </Route>
          <Route path='/sign-up'>
            <Account />
          </Route>
        </Switch>
        </div>
      </Router>

  )
}
export default App;
